import React, { Component } from 'react'
import { Container, Row, Col, Button } from 'reactstrap';
import ui from '../assets/hero-ui.png'
import '../Home/Home.css'

class Home extends Component {   
  render (){
    return (

        <div className="App">
            <div className="App-header">
        <Container>
                <Row>
                    <Col className="header-text" md="6">
                    <h1>An effortless donation experience for ambitious charities</h1>
                    <Button className="Request-btn">Request Demo</Button>
                    </Col>

                    <Col md="6">
                    <img className="givable-img" src={ui}  alt="Givable" />
                    </Col>
                </Row>
             </Container>
             </div>
      </div>
   
    )
  }
   
}

export default Home;
